import React, { Component } from "react";
import './App.css';
import clickers from "./clickers.json";



class App extends Component {

  state = {
    clickers
  };

  render() {
    return(
    <div>
      {this.state.clickers.map(donky => (
        <p>{donky}</p>
      ))}
    </div>
    )
  }

}
export default App;
